import { useEffect, useState } from 'react';
import './App.css';

function App() {
  const [data, setData] = useState([])
  useEffect(()=>{
    fetch('http://localhost:8081/clients')
    .then(res => res.json())
    .then(data => setData(data))
    .catch(err => console.log(err))
  }, [])
  return (
    <div>
      {data.map((d, i) =>{
        <div key={i}>
          <div>{d.name}</div>
          {d.phone}
        </div>
      })}
    </div>
  );
}

export default App;
